        <li><Link to='/about'>go to About</Link></li>
        <li><Link to='/contact'>go to Contact</Link></li>
        <li><Link to='/help'>go to Help</Link></li>
      </ul>
      <Routes>
          {/* exact or index :zid w7da fe hado b7al b7al */}
